import Login from "./Authentication/Login";
import Register from "./Authentication/Register";

var routes = [
  {
    path: "/login",
    name: "Login",
    icon: "ni ni-key-25 text-info",
    component: Login,
    layout: "/auth",
    visible: false,
    children: [],
  },
  {
    path: "/register",
    name: "Register",
    icon: "ni ni-circle-08",
    component: Register,
    layout: "/auth",
    visible: false,
    children: [],
  },
];
export default Route;
